function Lap(json) {
    var data = JSON.parse(json);
    this.count = data.count;
    this.valid = data.valid;
    this.laptime = data.laptime;
    this.points = data.points;
}

Lap.prototype.min_x = function() {
    var min = 0;
    for (var i = 0; i < this.points.length; i++) {
        if (this.points[i].x < min)
            min = this.points[i].x;
    }
    return Math.abs(min);
}

Lap.prototype.min_z = function() {
    var min = 0;
    for (var i = 0; i < this.points.length; i++) {
        if (this.points[i].z < min)
            min = this.points[i].z;
    }
    return Math.abs(min);
}

Lap.prototype.toSvgPath = function() {
    var path = '';
    var min_x = this.min_x() + 10; // 10: padding
    var min_z = this.min_x() + 10;

    if (this.points.length > 0)
        path += 'M' + (this.points[0].x + min_x) + ',' + (this.points[0].z + min_z);
    else
        return path

    for (var i = 0; i < this.points.length; i++) {
        path += ' L' + (this.points[i].x + min_x) + ',' + (this.points[i].z + min_z);
    }
    return path
}

